import React from 'react'
import { Summary } from '../Summary'
import { shippingProvider } from '../../../assets/shippingMethod';


type Props = {}

export const ShippingSummary = (props: Props) => {

    const days = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday']

  return (
    <Summary>
        <div className='h-[470px] py-5'>
            {shippingProvider.map(company => {
                return (
                <div className="flex bg-gray-50 p-3 rounded-lg mb-3">
                        <img src={company.image} alt={company.name} className='object-contain h-[70px] w-[100px] rounded-lg'/>
                        <section className="text-xs ml-5 flex flex-col justify-around w-[170px]">
                            <p>{company.name}</p>
                            <section className="flex justify-between text-gray-500">
                            <p>{company.type}</p>
                            <p>{`${days[new Date().getDay() + company.expectArrive]}, ${new Date().getDate() + company.expectArrive}`}</p>
                            </section>
                            <p className="font-medium">${company.cost}</p>
                        </section>
                </div>
                )
            })}
        </div>
    </Summary>
  )
}
